import React from 'react'
import { NavLink, Link } from 'react-router-dom'
import './Nav.css'
import PropTypes from 'prop-types'
import PlaylistContext from './PlaylistContext'

export default function Nav(props) {
    // console.log(props)
    let output = (value) => {
        console.log(value)

        return value.playlists.map(playlist =>
            <NavLink exact key={playlist.id} to={`/playlist-display/${playlist.id}`}>
                <h2 id={playlist.id} className="navLink">{playlist.title}</h2>
                <span></span>
            </NavLink>)
    };


    return (
        <PlaylistContext.Consumer>
            {(value) => {
                let playlistOut = output(value)
                return playlistOut && (
                    <div id="navBar">
                        {playlistOut}
                        <Link to={'/add-folder'}  >
                            <h2 className="addFolder">Add folder</h2>
                        </Link>
                    </div>
                )

            }
            }
        </PlaylistContext.Consumer>

    )
}

Nav.propTypes = {
    folders: PropTypes.arrayOf(PropTypes.shape({
        id: PropTypes.number.isRequired,
        name: PropTypes.string.isRequired,
    }))
}
